import React from "react";
import { Avatar, Text, Container, Center } from "@chakra-ui/react";

type skillTileProps = {
    skillName: string
}

const SkillTile = (props: skillTileProps) => {
    return (
        <Center bg='green.600' maxWidth='100%' h='100vh'>
            <Container>
                <Avatar name={props.skillName} src={'../media/' + props.skillName + '.png'} />
                <Text textAlign='center'>
                    {props.skillName}
                </Text>
            </Container>
        </Center>
    )
}

export default SkillTile
